import { Link } from 'react-router-dom'
import { useGlobal } from 'reactn'
import LogoutButton from '../components/LogoutButton'

const Home = () => {
  const [user, setUser] = useGlobal("user")

  return (
    <nav className='flex'>
      {!user && <>
        <Link className="ml-2 p-1 w-[4.5rem] pt-1.5 text-center  bg-white border-2 border-white rounded-lg" to="/login">Login</Link>

        <Link className="ml-2 p-1 pt-1.5 w-[4.5rem] text-white text-center bg-green-600 border-2 border-green-600 rounded-lg" to="/signup">Signup</Link>
      </>}
      {user && <LogoutButton to="/">Logout</LogoutButton>}
    </nav>
  )
}

export default Home
